import RenderUsers from '../reusables/RenderUsers';
import CardUser from '../reusables/CardUser.js';
import { HashRouter as Router, Route, Switch } from 'react-router-dom';
import Card2 from '../reusables/Card2.js';


 const MiddlePage = () =>{

  return (
    <div className='middlePage'>





      <div className='content'>

      <Router>
      <Switch>
        <Route exact path="/" component={CardUser} />
        <Route path="/mods" component={CardUser} />
        <Route path="/contact" component={CardUser} />
      </Switch>
    </Router>





      </div>



    </div>

  )
}

export default MiddlePage;
